import { Typography } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

function Profile() {
  return (
    <>
      <Box>
        <Typography>
          About us 
        </Typography>
        <Typography>
        About us We're on a mission to make building UIs more accessible Our
          mission is to empower anyone to build UIs, faster. We're reducing the
          entry barrier, making design skills accessible.
        </Typography>
      </Box>
    </>
  );
}

export default Profile;
